import React from 'react';
import NoticeList from '../../components/common/NoticeList';

const NoticeListContainer = ({ messages }) => {
  const onAccept = (e) => {
    e.stopPropagation();
    console.log('accept');
  };
  const onRefuse = (e) => {
    e.stopPropagation();
    console.log('refuse');
  };
  return (
    <NoticeList messages={messages} onAccept={onAccept} onRefuse={onRefuse} />
  );
};

export default NoticeListContainer;
